import React from "react";
import { Link } from "react-router-dom";
const NavBar=()=>{
    return( 
    <>
    <NavLink
     to="/">About Us</NavLink
    >
    <NavLink
     to="/contact">Contact Us</NavLink
    >
    <NavLink
     to="pikachu">Pikachu</NavLink
    >
    {/* <Link>pikachu</Link> */}
    <a href="/">About Us</a>
    <a href="/contact">Contact Us</a>
    <a href="/pikachu">Pikachu</a>
    </>);
}
export default NavBar;
